g.title:
return <>
				<ul className="cart-drawer__services list-unstyled row mt-3 my-4 text-center">
					{tSettings.cartServices.map((t, index) => <li key={t} className="col-4 d-flex flex-column">
							{tSettings.cartServicesIcon[index] === 'delivery' && <SvgDelivery className="svg text-secondary" />}
							{tSettings.cartServicesIcon[index] === 'awards' && <SvgAwards className="svg text-secondary" />}
							{tSettings.cartServicesIcon[index] === 'moneyback' && <SvgMoneyback className="svg text-secondary" />}
							{t}
						</li>)}
				</ul>

				{this.state.afterpay && <afterpay-placement ref={r => {
    this.afterpayRef = r;
  }} className="text-center border-top m-0 pt-2" data-locale={locale} data-currency={currency} data-amount={this.state.totalPrice / 100} data-size="sm" />}

				{this.state.klarna && <p className="font-size-sm text-center border-top mt-2 pt-2 text center">
						<span dangerouslySetInnerHTML={{
      __html: klarnaIns
    }} />
						<br />
						<img className="mr-1" height="15" src={assetUrl('logo-klarna.svg')} alt="Klarna" />
						<svg data-toggle="modal" href="#modal-klarna" role="button" data-price={this.state.totalPrice} className="svg-info modal-klarna-trigger cursor-pointer" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16" width="12" height="12"><path d="M7.2 5.6h1.6V4H7.2M8 14.4A6.4 6.4 0 1114.4 8 6.408 6.408 0 018 14.4M8 0a8 8 0 105.657 2.343A8 8 0 008 0m-.8 12h1.6V7.2H7.2z" /></svg>
					</p>}

				{!this.state.afterpay && !this.state.klarna && <a href="/checkout" className="text-center">
						<div className="cart-drawer__shopify-icon d-flex align-items-center justify-content-center">
							<img className="d-block mx-1" src={assetUrl('shopify-payment.svg')} width="112" alt="Shopify Icon" />
						</div>

						{tSettings.cart_payment_icons && <img className="d-block mx-auto my-2" src={tSettings.cart_payment_icons} width="240" alt="Payments" />}
					</a>}
			</>
